import './Header.css'; // Импортируем файл со стилями
import headerLogo from "../../assets/HeaderLogo.jpeg?url"

function Header() {
  return (
    <div className="container-header">
      <div className="header">
        <img src={headerLogo}></img>
      </div>
    </div>
  );
}

export default Header;
